class Person:
    def __init__(self, name: str = "", age: int = 0) -> None:
        self._name = name
        self._age = age

    def get_name(self) -> str:
        return self._name

    def get_age(self) -> int:
        return self._age

    def __str__(self) -> str:
        return f"person:{self._name}:{self._age}"
